var hanUtils={getLocalStorage:function(key){var exp=6048e5;if(localStorage.getItem(key)){var vals=localStorage.getItem(key),dataObj=JSON.parse(vals),isTimed,newValue;return(new Date).getTime()-dataObj.timer>exp?(localStorage.removeItem(key),null):dataObj.val}return null},isQuotaExceeded:function(e){var quotaExceeded=!1;if(e)if(e.code)switch(e.code){case 22:quotaExceeded=!0;break;case 1014:"NS_ERROR_DOM_QUOTA_REACHED"===e.name&&(quotaExceeded=!0)}else-2147024882===e.number&&(quotaExceeded=!0);return quotaExceeded},setLocalStorage:function(key,value){var curtime=(new Date).getTime(),valueDate=JSON.stringify({val:value,timer:curtime});try{localStorage.setItem(key,valueDate)}catch(e){isQuotaExceeded(e)?(console.log("Error: 本地存储超过限制"),localStorage.clear()):console.log("Error: 保存到本地存储失败")}}};